package com.jiang.utils;

import com.alibaba.fastjson.JSONObject;
import com.baidu.ai.aip.utils.HttpUtil;
import com.baidu.ai.aip.utils.GsonUtils;
import com.jiang.utils.AuthService;

import java.util.*;

/**
 * 人脸搜索
 */
public class FaceSearch {

    /**
     * 重要提示代码中所需工具类
     * FileUtil,Base64Util,HttpUtil,GsonUtils请从
     * https://ai.baidu.com/file/658A35ABAB2D404FBF903F64D47C1F72
     * https://ai.baidu.com/file/C8D81F3301E24D2892968F09AE1AD6E2
     * https://ai.baidu.com/file/544D677F5D4E4F17B4122FBD60DB82B3
     * https://ai.baidu.com/file/470B3ACCA3FE43788B5A963BF0B625F3
     * 下载
     */
    public static List<User_list> faceSearch(String image) {
        // 请求url
        String url = "https://aip.baidubce.com/rest/2.0/face/v3/search";
        try {
            Map<String, Object> map = new HashMap<>();
            map.put("image", image);
            map.put("liveness_control", "NONE");
            map.put("group_id_list", "student");
            map.put("image_type", "BASE64");
            map.put("quality_control", "NORMAL");
            map.put("max_user_num", "3");   //查找后返回的用户数量。返回相似度最高的几个用户，默认为1，最多返回50个

            String param = GsonUtils.toJson(map);

            // 注意这里仅为了简化编码每一次请求都去获取access_token，线上环境access_token有过期时间， 客户端可自行缓存，过期后重新获取。
            String accessToken = AuthService.getAuth();

            String result = HttpUtil.post(url, accessToken, "application/json", param);
            JSONObject pa=JSONObject.parseObject(result);
            String result2 = pa.getString("result");
            pa=JSONObject.parseObject(result2);
            String user_list = pa.getString("user_list");
            System.out.println("user_list:"+user_list);
            List<User_list> list = JSONObject.parseArray(user_list, User_list.class);
            String face = list.get(0).getUser_id();
            System.out.println(face);
            return list;
            //System.out.println(result);
           // return result;
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }

    public static void main(String[] args) {
        FaceSearch.faceSearch(
                ""
        );
    }
}